    vector<vector<int>> kClosest(vector<vector<int>>& points, int K) {
        priority_queue<pair<int,pair<int,int>>> maxHeap;
        for (auto point : points) {
            int x = point[0], y = point[1];
            int distance = x * x + y * y;
            if (maxHeap.size() < K) {
                maxHeap.push({distance, {x, y}});
            } else {
